import './App.css';
import Navigation from "./Navigation";

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1 className="page-title">Inventory Management System (IMS)</h1>
                <Navigation />
            </header>
        </div>
    );
}

export default App;
